# Klijent pokrenuti s --default-character-set=utf8 
drop database if exists knjiznica;
create database knjiznica DEFAULT CHARACTER SET utf8  DEFAULT COLLATE utf8_general_ci;
use knjiznica;
CREATE TABLE autor(
   sifra 			int NOT NULL PRIMARY KEY,
   ime			  varchar(50) NOT NULL,
   prezime	  varchar(50) NOT NULL,
   datumrodenja datetime) DEFAULT CHARACTER SET = utf8 COLLATE = utf8_general_ci; 

CREATE TABLE izdavac(
   sifra	  int NOT NULL PRIMARY KEY,
   naziv	  varchar(50) NOT NULL,
   aktivan  boolean) DEFAULT CHARACTER SET = utf8 COLLATE = utf8_general_ci;

CREATE TABLE mjesto(
   sifra		  int NOT NULL PRIMARY KEY,
   naziv		  varchar(50) NOT NULL,
   postanskiBroj varchar(10),
   drzava			 varchar(50) DEFAULT 'Hrvatska' ) DEFAULT CHARACTER SET = utf8 COLLATE = utf8_general_ci;
CREATE TABLE katalog(
   sifra	  int NOT NULL PRIMARY KEY,
   autor	  int ,
   naslov	  varchar(50) NOT NULL,
   izdavac  int ,
   mjesto   int )DEFAULT CHARACTER SET = utf8 COLLATE = utf8_general_ci;

alter table katalog add foreign key (autor) references autor(sifra);
alter table katalog add foreign key (izdavac) references izdavac(sifra);
alter table katalog add foreign key (mjesto) references mjesto(sifra);












